import React from 'react'

export default function List_View() {
    const data =
        ['Use Array.map',
            'Not a for loop',
            'Give each item a unique key',
            'Avoid using array index as the key']
    // const listItems = data.map((value) =>
    //     <li>{value}</li>
    // );
    const listItems = data.map((value) =>
        <li key={value.toString()}>
            {value}
            <input type="checkbox" name="" id="" />
        </li>
    );
    return (
        <ul>{listItems}</ul>
    )
}
